create table compra (
	cod_compra INT PRIMARY KEY,
	dt_compra DATE,
	hora_compra VARCHAR(50),
	qtd INT,
	desconto VARCHAR(2),
	cod_cliente INT,
	cod_calcado INT,
	cod_avaliacao INT,
	FOREIGN KEY(cod_cliente)REFERENCES cliente (cod_cliente),
	FOREIGN KEY(cod_calcado)REFERENCES calcados (cod_calcado),
	FOREIGN KEY(cod_avaliacao)REFERENCES avaliacao (cod_avaliacao)	
);
